import React, { Component } from "react";

//input: liked: boolean
//output: onClick
class Like extends Component {
  // state = {  }
  render() {
    let classes = "fa fa-heart";
    if (!this.props.liked) {
      classes += "-o";
    }
    return (
      <i
        onClick={this.props.onClick} //you could call this last variable anything
        className={classes}
        aria-hidden="true"
      ></i>
    );
  }
}

export default Like;
